import * as request from '../../utils/request'
const endPoints = {
    register: '/users/register',
    login: '/users/login',
    logout: '/users/logout'
};

const reigister =  async ({email,password}) => {
    let user = await request.post(endPoints.register,{email,password});
    return user;
};


export{
    reigister,
}
